import React from 'react'

export const NewGameForm = () => {
  return (
    <>
    <form>
        <input type='text'>Name</input>
        <input type='number' min="1" max="5">No. of Players</input>
        <input type='text'>Difficulty</input>
        <input type='number' min="1" max="20">No. of Questions</input>
    </form>
    </>
  )
}
